import React from 'react';
import Button from '../Button';

const tracks = [
  {
    id: '1',
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    entryFee: 0,
    ranking: [
      {
        name: 'First',
        win: 5
      },
      {
        name: 'Second',
        win: 2
      },
      {
        name: 'Third',
        win: 1
      }
    ],
    color: '#15a13a',
    button: <Button name='Entry Free' fee={0} color='#15a13a' path='track/1' />
  },
  {
    id: '2',
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    entryFee: 1,
    ranking: [
      {
        name: 'First',
        win: 10
      },
      {
        name: 'Second',
        win: 7
      },
      {
        name: 'Third',
        win: 5
      }
    ],
    color: '#bf9713',
    button: <Button name='Track #1' fee={1} color='#bf9713' path='track/2' />
  },
  {
    id: '3',
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    entryFee: 5,
    ranking: [
      {
        name: 'First',
        win: 15
      },
      {
        name: 'Second',
        win: 10
      },
      {
        name: 'Third',
        win: 7
      }
    ],
    color: '#bf8013',
    button: <Button name='Track #2' fee={5} color='#bf8013' path='track/3' />
  },
  {
    id: '4',
    title: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    description: 'Lorem ipsum dolor, sit amet consectetur adipisicing.',
    entryFee: 10,
    ranking: [
      {
        name: 'First',
        win: 5
      },
      {
        name: 'Second',
        win: 2
      },
      {
        name: 'Third',
        win: 1
      }
    ],
    color: '#bf6913',
    button: <Button name='Track #3' icon='...' color='#bf6913' path='track/4' />
  }
];

export default tracks;
